import React from 'react';
import ReactDOM from 'react-dom/client';
import "./style.css"

import one from "./asset/images/p-1.jpg";
import two from "./asset/images/p-2.jpg";
import three from "./asset/images/p-3.jpg";

const root = ReactDOM.createRoot(document.getElementById('root'));

// Creating navbar Component

function Navbar(){
  return(
    <nav>
        <h1>Perfumy</h1>
        <ul>
            <li>Home | </li>
            <li>Products | </li>
            <li>About | </li>
            <li>Contact </li>
        </ul>
        </nav>

  )
}

// Search Components

function Search(){
  return(
    <div className="searchbar">
     <input type="text" placeholder="Search"/>  
     </div>
  )
}

// Product Components

function Product(){
  return(
    <div class="products">
            <div class="box">
                <img src={one}></img>
                 <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
            </div>

            <div class="box">
                <img src={two}></img>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
            </div>
            <div class="box">
                <img src={three}></img>
                <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
            </div>
        </div>
  )
}

// About components
root.render(<div>
  <Navbar></Navbar>
  <Search></Search>
  <Product></Product>

</div>);
